import { defineStore } from 'pinia';
import axios from 'axios';

export const useTaskStore = defineStore('taskStore', {
  state: () => {
    return {
      tasks: [],
    };
  },
  actions: {
    getTask() {
      axios
        .get(url + `/api/tasks`)
        .then((response) => {
          response.data;
        })
        .catch((error) => {
          console.log(error);
        });
    },
  },
});
